import React from'react';
import './App.css';
import Navbar from './components/navbar';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';

function App() {
  return (
    <>
      <Router>
        <Navbar/>
        <Switch>
          <Route exact path='/' component={Home}/>
        </Switch>
      </Router>
    </>
    );
}

export default App;
